import React from 'react'
import { Link, useNavigate } from 'react-router-dom'
import './sel.css'

function Selection() {
    let navigate = useNavigate();

    return (
        <div>
            <div className='user'>
                <button onClick={() => navigate('/Login')}><h1 > Login as Customer</h1></button>
                <a onClick={(sign) => navigate('/SignUp')}><h1 >signup</h1></a>
            {/*     Create your account....<Link to='/SignUp'><h5>Signup</h5> */}
            </div>
            <div className='wash'>
                <button onClick={() => navigate('/Login')}><h1 > Login as Washer</h1></button>
              {/*   <h5>Create your account....<a href='/sign-up'>Signup</a></h5> */}
            </div>
        </div>
    )
}

export default Selection
